import { NewLableService } from './new-lable.service'
export default {
  serviceInject() {
    return {
      Service: NewLableService
    }
  },
  components: {},
  name: 'newLable',
  props: {
    selectedRowData: {
      type: Array
    }
  },
  data() {
    return {
      show: false,
      inputLable: ''
    }
  },
  methods: {
    getLableList() {
      let self = this
      self.Service.setMemberLabel({ tag_name: self.inputLable }).subscribe(
        state => {
          self.show = false
          self.$emit('done', true)
        }
      )
    },
    save(e) {
      e.preventDefault()
      this.getLableList()
    }
  }
}
